import Home from './pages/Home'; // Assuming you have these components
import About from './pages/About';
import ChildComponent from './pages/ChildComponent'
import {BrowserRouter as Router} from 'react-router-dom';
import {Routes as Routes} from 'react-router-dom';
import {Route as Route} from 'react-router-dom';
import {useState} from 'react';
import axios from 'axios';


function App() {
  //const [stvar, setMess] = useState('');
  //const [displayText, setDisplayText] = useState('');
  //const handleClick = (event) => {
    //axios.get('http://localhost:8080/helphealth')
    //.then(response => setMess(response.data))
    //console.log(stvar);
    //setDisplayText('Hello');
  //}
  const userName = 'Alice';
  return (
    <Router>
      <div>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<ChildComponent name={userName}/>} />
      </Routes>
      <a href="/">Home</a>
      <a href="/about">About</a>
      </div>
    </Router>
  );
}

export default App;
